import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { NavigationBar } from './components/NavigationBar';


function Musichome(){
    return(
<React.Fragment>
<Router>
  <NavigationBar />
  <Switch>
  <Route exact path="/"/>
  <Route path="/about"/>
</Switch>
</Router>
</React.Fragment>
    )}
  export {Musichome};
